import { Avatar, Button, TextField, Paper, Box, Grid, Typography } from '@mui/material';
import { Person2Outlined } from '@mui/icons-material';

export function RecoverPassword() {
    const handleSubmit = (event) => {
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
          email: data.get('email'),
          password: data.get('password'),
        });
      };

    return(
        <Grid 
          item
          xs={12}
          sm={8}
          md={5}
          component={Paper}
          elevation={6} 
          square
          marginLeft={3}
          marginRight={3}
        >
          <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              px: 4,
            }}
          >
            <Typography component="h1" variant="h5">
              Recuperar Contrase√±a
            </Typography>
            <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
            <TextField
                margin="normal"
                required
                fullWidth
                id="name"
                label="Nombre"
                name="name"
                autoFocus
              />
              <TextField
                margin="normal"
                required
                fullWidth
                id="lastname"
                label="Apellidos"
                name="lastname"
                autoFocus
              />
              <TextField
                margin="normal"
                required
                fullWidth
                id="phone"
                label="Numero de celular"
                name="phone"
                autoFocus
              />
              <Box
                sx={{
                  display: 'flex',
                  flexDirection: 'row',
                  gap: 4
                }}
              >
                <Button
                  type="button"
                  fullWidth
                  variant="contained"
                  color='secondary'
                  sx={{ mt: 3, mb: 2 }}
                >
                  Regresar
                </Button>
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  color='info'
                  sx={{ mt: 3, mb: 2 }}
                >
                  Confirmar
                </Button>
              </Box>
            </Box>
          </Box>
        </Grid>
    );
}
